    name: 'Ed',
    age: 25,
    posts: ['whatever', 'whatever pt2']
  })

  const increment = () => {
    setCount(count+1);
    setRed(!isRed)
  }
  return(
    <div className='app'>
      <h1 className={isRed ? "red" : ""}>Change my color!</h1>
      <button onClick={increment}>Increment</button>
      <h1>{count}</h1>
    </div>

  );

}

